import { HttpClient, HttpResponse } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { Visite } from 'src/app/models/Visite';
import { User } from '../models/User';

@Injectable({
  providedIn: 'root'
})
export class VisiteService {

  private apiUrl = 'https://localhost:7129/api/Visites';

  constructor(private http: HttpClient) { }
  add(Visite: Visite): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', Visite);

    return this.http.post<any>(`${this.apiUrl}/add`, Visite, { observe: 'response' });
  }
  GetUsers(): Observable<User[]> {
    return this.http.get<User[]>('https://localhost:7129/api/Visites/get/user');
  }
  getById(PatientId: number): Observable<Visite[]> {
    return this.http.get<Visite[]>(`${this.apiUrl}/${PatientId}`);
  }

}
